import React, {Component} from 'react';
import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';
import Home from './Components/Home/Home';
import WAW from './Components/WAW/WAW';
import Works from './Components/Works/Works';
import Exhib from './Components/Exhib/Exhib';
import Contact from './Components/Contact/Contact';

function App() {
    return (
        <Router>
            <div>
                <h2>Welcome to React Router Tutorial</h2>
                <nav className="navbar navbar-expand-lg navbar-light bg-light">
                    <ul className="navbar-nav mr-auto">
                        <li><Link to={'/'} className="nav-link">Breakfast</Link></li>
                        <li><Link to={'/who_are_we'} className="nav-link"> WAW </Link></li>
                        <li><Link to={'/works'} className="nav-link">Works</Link></li>
                        <li><Link to={'/exhib'} className="nav-link">Exhib</Link></li>
                        <li><Link to={'/contact'} className="nav-link">Contact</Link></li>
                    </ul>
                </nav>
                <hr />
                <Switch>
                    <Route exact path='/' component={Home} />
                    <Route path='/works' component={Works} />
                </Switch>
            </div>
        </Router>
    );
}

export default App;
